window.bookSummaryJSON = "<p><b>After saving the world many times, the Merry Band of Pirates have accepted the inevitable: Earth is doomed. </b></p> <p>All they can do is try to bring a few thousand people to safety, before vicious aliens arrive to destroy humanity's home world.&nbsp;</p> <p>No.&nbsp;</p> <p>There is one other thing they can do: hit the enemy so hard that the aliens will regret they ever heard of humans.</p>"; 
